import React from "react";

const customAlert = () => {
    return (
        <div>
        <Alert onClose={() => {}}>This is a success alert — check it out!</Alert>
        <Alert
        action={
            <Button color="inherit" size="small">
            UNDO
            </Button>
        }
        >
        This is a success alert — check it out!
        </Alert>
        </div>
    )
}

export default customAlert;
